// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract TransferContract {

  address owner;
  address senderAG;
  address receiverAG;
  // 用來登記雙方AG的同意
  bool[2] AGs_Agreements; // 0:sender, 1:receiver

  constructor() public {
    owner = msg.sender;     
    AGs_Agreements = [false,false];
  }


  modifier onlyRecevierAG{
      require(msg.sender == receiverAG, "ReceiverAG address error");
      _;
  }
  modifier onlySenderAG{
      require( msg.sender == senderAG , "SenderAG address error");
      _;
  }
  modifier onlyOwner{
    require(msg.sender == owner, "CA Authentication failed");
    _;
  }
  modifier payRequirement(address from, address to){ 
    // check if from address right
    // check if to address right
    require(msg.sender == senderAG,"sender AG address wrong");
    require(from == transaction.from, " Sender address wrong");
    require(to == transaction.to, "Receiver address wrong");
    _;
  }
  // 確保雙方AG都同意交易
  modifier Agreements(){
      require(AGs_Agreements[0]==true, "Sender AG has not agreed yet");
      require(AGs_Agreements[1]==true, "Receiver AG has not agreed yet");
      _;
  }

  struct Transaction{
      address from; 
      address to;

      uint256 FromBalance;
      uint256 ToBalance;
      uint256 TotalBalance;

      // 限制一定要在40個步驟內結束交易
      uint256[10] txnHistory;
      uint8 step; 
  }

  Transaction transaction;

  // 
  function getAGs() public view returns (address, address){
      return (senderAG, receiverAG);
  }


  // CA部屬後要設定AG
  function setAGs(address sender, address receiver)public onlyOwner{
      senderAG = sender;
      receiverAG = receiver;
  }
  // AG status 
  function setAgreements(bool status)public returns(bool){
      if(!(msg.sender==senderAG) || !(msg.sender==receiverAG)){
          return false;
      }
      if(msg.sender == senderAG){
          AGs_Agreements[0] =status;
      }else{
          AGs_Agreements[1]=status;
      }
      return true;
  }

  // 建立交易channel
  function createTransaction(address _from, address _to, uint256 balance, uint256 signature) public Agreements returns(bool){
        // Need modifier;
        // 只有AG雙方同意才可以

        Transaction memory trans;
        trans.from = _from;
        trans.to = _to;
        trans.TotalBalance = balance;
        trans.FromBalance = balance;
        trans.ToBalance = 0;

        trans.step = 0;
        // save the chameleon signature
        trans.txnHistory[trans.step]=signature;


        transaction = trans;


        // 把AG們的同意改回false
        AGs_Agreements[0]=false;
        AGs_Agreements[1]=false;
        return true; //

  }

    // 紀錄交易的每個步驟
  function Payment(address _from, address _to, uint balance) public Agreements payRequirement(_from, _to) returns(bool){
        // Need modifier;  
        // AG雙方須同意
        // 接收發送方及金額都需要與創建時一致
        // step can not over 10  
        require(transaction.step <10, "step is excced to 10");

        transaction.FromBalance-=balance;
        transaction.ToBalance+=balance;
        transaction.step+=1; 
        return true;
    }

    function checkStep() public view returns(uint){
        return transaction.step;
    }


    // selfdestruct needs to be defined
  function endContract() public onlyOwner payable{


    address payable Payfrom = address(uint160(transaction.from));
    address payable Payto = address(uint160(transaction.to));

    Payfrom.transfer(transaction.FromBalance);
    Payto.transfer(transaction.ToBalance);

    address conAddr = address(this);

    address payable PayOwner = address(uint160(owner));
    if (conAddr.balance >0)
        PayOwner.transfer( conAddr.balance);


    selfdestruct(PayOwner);
  }


}
